export function defaultStyle(feature: FeatureLike): Style {
    let style: Style = new Style({
        fill: new Fill({
            color: getFillColor(feature.get('count'), collArr),
        }),
        stroke: new Stroke({
            color: getFillColor(feature.get('count'), collArr),
        })
    });
    return style;
}

